import React from "react";
import { Link } from "react-router-dom";
import "./AddProduct.css";

function AddProduct() {
  return (
    <div classname="addProduct">
      <Link to="/">
        <img
          className="addProduct__logo"
          src="https://upload.wikimedia.org/wikipedia/commons/thumb/6/62/Amazon.com-Logo.svg/1200px-Amazon.com-Logo.svg.png"
          alt="logo"
        />
      </Link>
      <div className="addProduct__container">
        <h1>Sign-In</h1>
        <form>
          <h5>E-mail</h5>
          <input type="text" value="123" />
          <h5>Password</h5>
          <input type="password" value="345" />
          <button type="submit" className="addProduct__signInButton">
            Sign In
          </button>
        </form>
      </div>
    </div>
  );
}

export default AddProduct;
